import { useSelector } from "react-redux";

import Post from "./Post/Post";

const Posts = () => {
  const posts = useSelector(state => state.posts);

  return (
    <>
      {posts.map(post => {
       return (<div key={post._id}>
          <Post post={post} />
        </div>);
      })}
    </>
  );
};

export default Posts;
